Palmyre/<em>Tadmor</em>, sanctuaire de Baalshamîn. Deux consoles de colonne à tenon. 
<br> (Photographie en noir et blanc) 
<br> Inscription supérieure: console de colonne à tenon en calcaire dur et blanc avec une corniche moulurée. Dimensions: 50 x 46 x 86 cm. Le tenon mesure 20 x 43 x 20 cm. H. des lettres: 2 cm. Interlignes: 1.5 cm. L'inscription est mal conservée et on ne peut restituer que: &quot;Cette statue est celle de …, fils de …, fils de …,&quot; ainsi que &quot;parce qu'il leur a été agréable, au mois de … de l'an 414 (102/103 apr. J.-C.).&quot;
Inscription inférieure: console de colonne à tenon en calcaire dur, blanc avec une corniche moulurée très délitée (cf. IAS-COL-69547). Le corps de la console est structuré en deux registres. Dimensions: 46 x 43.6 x 72 cm. Le tenon mesure 40 x 16.5 x 16.5 cm. H. des lettres: 2 cm. Interlignes: 1 cm. Les lettres ont été tracées en peinture rouge. L'inscription est la suivante: &quot;Au mois de … de l'an 5.., cette statue est celle de Zabba, fils de Maqqaia, fils de Bôlhazai, fils de …, fils de Maqqaia, qui lui ont élevée les cavaliers de l'aile de Gamla et de Ana, parce qu'il leur a été agréable, en son honneur.&quot;
Les consoles ont été trouvées encastrées dans le mur sud des structures byzantines devant le <em>pronaos</em>, le 9 septembre 1954.

Palmyre/<em>Tadmor</em>, sanctuaire de Baalshamîn. Tambour de colonne. 
<br> (Photographie en noir et blanc) 
<br> En calcaire dur (cf. IAS-COL-69549). Un rectangle, portant l'inscription, est plus finement piqueté. Les lettres étaient peintes en rouge. L'inscription est la suivante: &quot;Ce portique tout entier a été offert par Yarhai, fils de Lishamsh, fils de Raai.&quot;

