Palmyre/<em>Tadmor</em>, sanctuaire de Baalshamîn. Fragment de statue, buste de jeune homme imberbe. Il porte une couronne de laurier avec une rosace à six pétales sur le devant. Trouvé le 6 octobre 1959 à l'angle ouest du vieux tombeau. Dimensions : 18 x 11.5 x 13 cm. 
<br>Légende: &quot;10 240&quot;
<br> (Photographie en noir et blanc)
